import React from "react";

function Form(props){
return (
  <div className="container">
  <form>
    <div className="form-group">
      <jumbotron style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron" htmlFor="search"><h2>Search for and save Books of Interest</h2></jumbotron>
      <input
        onChange={props.handleInputChange}
        value={props.search}
        name="search"
        type="text"
        className="form-control"
        placeholder="Search a Book"
        id="search"
      />
      <button onClick={props.handleFormSubmit} className="btn btn-dark mt-3 mb-5">
        Search
        </button>
    </div>
  </form>
  </div>
);
}

export default Form;
